sympy.sympy.polys.domains.field.quo:
def quo(self, a, b):
    """Quotient of ``a`` and ``b``, implies ``__truediv__``. """
    return a / b

sympy.sympy.polys.domains.gaussiandomain:
def gcd(self, a: GaussianInteger, b: GaussianInteger) -> GaussianInteger:
    """Greatest common divisor of a and b over ZZ_I."""
    while b:
        a, b = b, a % b
    unit = self.canonical_unit(a)
    return a*unit

sympy.sympy.polys.domains.integerring.gc:
def gcd(self, a, b):
    """Compute GCD of ``a`` and ``b``. """
    return gcd(a, b)

sympy.sympy.polys.domains.polynomialring:
def gcd(self, a, b):
    """Returns GCD of `a` and `b`. """
    return a.gcd(b)

sympy.sympy.polys.domains.realfield.gcd:
def gcd(self, a, b):
    """Returns GCD of ``a`` and ``b``. """
    return self.one

sympy.sympy.polys.domains.ring.quo:
def quo(self, a, b):
    """Quotient of ``a`` and ``b``, implies ``__floordiv__``. """
    return a // b
